import "./App.css";
import registro from "./images/registro-juridica-sin-lucro-ok.png";
import logo from "./images/logo-registro-civil-300-jpg copy.jpg";
import compromisos from "./images/compromisos-de-gestion-institu-ok.png";
import gobierno from "./images/gobierno-transparente-sole-ok.png";
import codigo from "./images/codigo-de-etica-ok.png";
import participacion from "./images/banner-320-x-60-participacion-ciudadana-1.jpg";
import solicitud from "./images/solicitud-info-ley-transparencia-ok.png";
import seguridad from "./images/banner-320-x-60-seguridad-de-la-informacion.png";
import clarciev from "./images/banner_clarciev-1.jpg";
function App() {
  return (
    <div className="App">
      <div className="background-header">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>

      <div className="background-grey1">
        <div className="box1-grey">
          <div>
            <img classNamesrc={registro} alt="" />
          </div>
          <div>
            <img src={compromisos} />
          </div>
          <div>
            <img src={gobierno} />
          </div>
        </div>
        <div className="box1-grey">
          <img src={codigo} alt="" />
          <img src={participacion} />
          <img src={solicitud} />
          <img src={seguridad} />
        </div>
        <div>
          <img className="round-long-image" src={clarciev} />
        </div>
      </div>
    </div>
  );
}

export default App;
